import React from 'react'

import './random-planet.css'

const RandomPlanet = () => {
   return(
       <div className="header d-flex">
          <img src = "url" alt = 'pict show'/>
       <ul className="d-flex">
           <li>
               <a href = "#">People</a>
           </li>
           <li>
               <a href = "#">Planet</a>
           </li>
           <li>
               <a href = "#">StarShip</a>
           </li>
       </ul>
       </div>
   );
};

export default RandomPlanet;
